import React from "react";
import ReactDom from "react-dom";

function Footer() {
  var today = new Date();
  var CurrentYear = today.getFullYear();

  return ReactDom.render(
    <footer>
      <p>Copyright {CurrentYear}</p>
    </footer>
  );
}

export default Footer;
